import React, { Component } from 'react';
import './App.scss';
import Header from './components/Header';
import DroneBanner from './components/DroneBanner';
import DroneDesign from './components/DroneBanner';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header onScroll={this.handleScroll} />
        <DroneBanner />
        <DroneDesign />
      </div>
    );
  }
}

export default App;
